// src/pages/Home.js
import React from 'react';
import { useNavigate } from 'react-router-dom';

export default function Home() {
  const navigate = useNavigate();

  const handleStart = () => {
    navigate("/login");
  };

  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-blue-100 text-center p-4">
      <h1 className="text-4xl font-bold mb-6">Welcome to Online MCQ Exam System</h1>
      <p className="text-lg mb-8">Prepare for your exams with practice questions</p>
      <button
        className="px-6 py-3 bg-blue-600 text-white text-lg rounded-lg hover:bg-blue-700"
        onClick={handleStart}
      >
        Start Exam
      </button>
    </div>
  );
}
